 für %s läuft in %s Tagen ab.','Your %s licence is going to expire in one day.'=>'Die Lizenz für %s läuft in einem Tag ab.','Your %s licence is going to expire today.'=>'Die Lizenz für %s läuft heute ab.','Your license could not be activated because it has already expired.'=>'Die Lizenz konnte nicht aktiviert werden, weil sie bereits abgelaufen ist.','Your license could not be activated because your domain limit has been reached.'=>'Die Lizenz konnte nicht aktiviert werden, weil das Domain-Limit bereits erreicht ist.','Your license could not be activated, the license key could not be found.'=>'Die Lizenz konnte nicht aktiviert werden, weil der Lizenzschlüssel nicht gefunden wurde.','Your license could not be activated, there is no valid license for %s for this key.'=>'Die Lizenz konnte nicht aktiviert werden, es gibt keine gültige Lizenz für %s für diesen Lizenzschlüssel.','Your license key could not be found.'=>'Der Lizenzschlüssel konnte nicht gefunden werden.']];
